import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from './NavStyles'

const Nav = () => {
    return (
      <div>
          <Link to={'/'}  style={{
            textAlign: 'center',
            marginRight: '8%',
            fontSize: '1.3rem',
            fontWeight: '500',
          }}> Home </Link>
          <Link to={'/contact'}  style={{
            textAlign: 'center',
            marginRight: '8%',
            fontSize: '1.3rem',
            fontWeight: '500',
          }}> Contact </Link>
        <header>
          <p>Nav</p>
        </header>
      </div>
    );
  }

  export default Nav;
